import React from 'react'
import { render } from 'react-dom'
import '../../App.css';
import Button from 'react-bootstrap/Button';
import DropdownButton from 'react-bootstrap/DropdownButton';
import Dropdown from 'react-bootstrap/Dropdown';
import Nav from 'react-bootstrap/Nav';
import Form from 'react-bootstrap/Form';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';


export default class Navibar extends React.Component{
    render() {
        return (
            <nav class="navbar navbar-expand-lg fixed-top navbar-dark bg-dark">



            <div class="navbar-collapse collapse w-100 order-1 order-md-0 dual-collapse2">


            <a class="navbar-brand" href="#">
            <img src="./logo_zerodebug_white.png" width="40"></img>
            </a>


            <a class="navbar-brand" href="#">touchAble</a>


            <a class="navbar-brand" href="#">modstep</a>


            <a class="navbar-brand" href="#">soda</a>
            <a class="navbar-brand" href="#">studiomux</a>

            </div>
            <div class="mx-auto order-0">
            <a class="navbar-brand mx-auto" href="#">Manual</a>
            <a class="navbar-brand mx-auto" href="#">Navbar 2</a>
            <button class="navbar-toggler" type="button" data-toggle="collapse" data-target=".dual-collapse2">
            <span class="navbar-toggler-icon"></span>
            </button>
            </div>
            <div class="navbar-collapse collapse w-100 order-3 dual-collapse2">
            <ul class="navbar-nav ml-auto">
            <li class="nav-item">
            <a class="navbar-brand" href="#">Forum</a>
            </li>
            <li class="nav-item">
            <a class="navbar-brand" href="#">Helpdesk</a>
            </li>
            </ul>
            </div>

            </nav>
            );
    }
}
